// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract CristoDapp{
    address public owner;
    uint private secureAddPercent = 5; // La comisin que nos llevamos
    address private noOne = address(0);
    IERC20 private token;

    struct User{
        string name;
        string contact;
        bool updated;
        uint totalproducts;
        uint[] products;
    }

    struct Product{
        string name;
        string desc;
        string section;
        uint price;
        address owner;
        address reserved_by;

    }

    Product[] private products;
    mapping(address=> User) public users;

    uint _totalUser;

    event ProductPurchase(address indexed user , address owner , uint price);
    event ProductAdd(address indexed owner, string name, uint price);

    constructor(address _token){
        owner = msg.sender;
        token = IERC20( _token);
        _totalUser = 0;

    }

    function setSecureAddPercent(uint percent) public isOwner {
        secureAddPercent = percent;


    }

    function getSecurePercent() private isOwner view returns(uint){
        return(secureAddPercent);

    }

    function __PercentValue(uint _amount) public view returns(uint){ // calcula la comisin.

        return(secureAddPercent * _amount)/100;

    }

    function __amount(uint _amount) public pure returns(uint){// calcula el amount a wei
        return _amount * (10**18);
    }

    function addProduct(string memory name, string memory desc, string memory  section, uint price) public {
        transferToken(address(this),__amount(__PercentValue(price)), msg.sender);
        products.push(Product(name, desc, section, __amount(price),msg.sender,noOne ));
        emit ProductAdd(msg.sender, name, __amount(price));
    }

    function transferToken(address _owner , uint _price , address _buyer)private {// se cobra la comision
        require(_price<= token.balanceOf(_buyer), "Insuficient tokens to make the transaction"); // comprobamos si hay suficiente dinero para realizar la transaccin
        require(token.allowance(_buyer, address(this))>= _price , "Insuficient allowance to make the transfer");// comprobamos si el contrat tiene permisos para ralizar la transaccin
        bool sent = token.transferFrom(_buyer, _owner, _price);
        require(sent, "Not sent");
    }

    function updateProductPrice(uint product_id, uint price) public{
        require(msg.sender != noOne);
        Product storage product = products[product_id];
        require(msg.sender==product.owner);
        require(product.reserved_by == noOne);
        product.price= __amount(price);
        
    }

    function updateUserContact(string memory contact, string memory name) public{
        require(msg.sender != noOne);
        User storage user = users[msg.sender];
        user.contact = contact;
        user.name = name;

         if(!user.updated)
            _totalUser++;

        user.updated = true;

    }

    function buyProduct(uint product_id)public{
        Product storage product = products[product_id];
        require(msg.sender != product.owner);
        transferToken(product.owner, product.price, msg.sender);
        User storage buyer = users[msg.sender];
        buyer.totalproducts += 1;
        buyer.products.push(product_id);// hacemos push del producto que compro
        product.reserved_by = msg.sender;

        emit ProductPurchase(msg.sender, product.owner, product.price);


    }

     function totalUsers() external view returns (uint){
        return _totalUser;
    }

    function getProducts() external view returns(Product[] memory){
      return products;
    }

    function getProduct(uint product_id) external view returns(Product memory){
      return products[product_id];
    }

    function getUser(address userAddress) external view returns(User memory){
      return users[userAddress];
    }

    function withdrawBNB(address payable account) external isOwner {
        (bool success, ) = account.call{value: address(this).balance}("");
        require(success);
    }

    function withdraw(address to, uint256 amount) external isOwner{
        require(token.transfer(to, amount));
    }




    modifier isOwner{
        require(msg.sender == owner);
        _;
    }

}
